import React from "react";
import {
    View ,Button, TextInput,StyleSheet
} from "react-native"
import { Formik } from "formik";
const SignUp=() =>{
    return (
        <View style={styles.container} > 
            <Formik
            initialValues={{name:'',email :'' , password:''} }
            onSubmit={(values) => {
                console.log(values)

            }}
            >
                {({ handleChange, handleBlur, handleSubmit, values })=>{
                    <View>
                        <TextInput 
                        style={styles.input}
                        placeholder='Name' 
                        onChangeText={handleChange('name')}
                        value={values.name}
                        />
                        <TextInput
                         style={styles.input}
                        placeholder='Email' 
                        onChangeText={handleChange('email')}
                        value={values.email}
                        />
                        <TextInput 
                        style={styles.input}
                        placeholder='password' 
                        onChangeText={handleChange('password')}
                        value={values.password}
                        />
                        <Button
                        title="Register now"
                        color='blue'
                        onPress={prohandleSubmit}
                        />
                    </View>
                }}
            </Formik>
        </View>

    )

} 
export default SignUp

const styles =StyleSheet .create({
    container:{
        flex:1,
        marginTop:25
    },
    input:{
        borderWidth:1,
        borderColor:'blue',
        padding:15,
        fontSize:15,
        borderRadius:5,
    }
})
